    @Override
    public String[] getAvailableCurrencies() {
        return CURRENCIES.clone();
    }

    @Override
    public String[] getCurrencyData(String name, int days, int year, int month, int day) {
        if(!Arrays.asList(CURRENCIES).contains(name)) {
            return new String[0];
        }

        String pattern = String.format("%s.0?%s.0?%s ", year, month, day);
        Pattern p = Pattern.compile(pattern);
        int startIndex = -1;
        for (int i = 0; i < DATA.length; i++) {
            Matcher m = p.matcher(DATA[i]);
            if (m.find()) {
                startIndex = i;
                break;
            }
        }

        if (startIndex == -1) {
            return new String[0];
        }

        int endIndex = startIndex + DATA_PER_DAY * days;
        if (endIndex > DATA.length) {
            endIndex = DATA.length;
        } else if (endIndex < startIndex) {
            endIndex = startIndex;
        }

        return Arrays.copyOfRange(DATA, startIndex, endIndex);
    }
